import background from "./images/hero-app-preview.png";

import "./App.css";

// ima
import { SignUp } from "./signUp/SignUp";
// imr
import React from "react";
// imrse
import { useState, useEffect } from "react";

function Header() {
  return (
    <div className="Header">
      <div class="logo">
        <div class="logo__img">
          <img src="{background}" alt="" />
        </div>
        <div class="logo__text">todo</div>
      </div>
      <div class="header__buttons">
        <div class="header__button button">sign in</div>
        <div class="header__button button btn-border">sign up</div>
      </div>
    </div>
  );
}
function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}
export default App;
